// WorkExperience.js
import React from 'react';

function WorkExperience() {
  return (
    <section id="work">
      <h2>Work Experience</h2>
      <div className="panel">
        <div className="panel-header">Arcesium</div>
        <div className="panel-body">
          <ul>
            <li>Software Engineer (July 2022 to July 2024)</li>
            <li>Software Engineering Intern (February 2022 - June 2022)</li>
            <li>Software Engineering Intern (May 2021 - July 2021)</li>
          </ul>
        </div>
      </div>
    </section>
  );
}


export default WorkExperience;
